import React from "react";
import { StyleSheet, Text, View, Image } from "react-native";
import { TextInput } from '../../components'
import { connect } from 'react-redux';
import 'redux';
import { RootState, Dispatch } from '../../store'

interface NavigationProps {
    navigation: any;
    route: any;
  }

const mapState = (state: RootState) => ({
    searchData: state.search.seriesData,
})

const mapDispatch = (dispatch: Dispatch) => ({
    setSeriesDataAsync: (seriesText: string) => dispatch.search.seriesData(seriesText)
})

type StateProps = ReturnType<typeof mapState>
type DispatchProps = ReturnType<typeof mapDispatch>
type Props = StateProps & DispatchProps & NavigationProps

class MasterDetail extends React.Component<Props> {
    componentDidMount() {
        const { masterDetailId } = this.props.route.params;
        console.log('masterDetailId', masterDetailId)
        this.props.setSeriesDataAsync(masterDetailId);
      }

    render() {
        console.log('searchData', this.props.searchData)
        return (
            <>

                <Text>MasteR dETAIL</Text>
            </>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: "center",
        margin: 10
    },
    logo: {
        width: 300,
        height: 300,
        marginBottom: 5
    }
})


export default connect(mapState, mapDispatch)(MasterDetail)
